RELEASE NOTES

Become the greatest detective of all time in The Testament of Sherlock
Holmes, a twisting, turning investigation game set in a
faithfully-reproduced London of 1898. Suspected in a case involving
theft, fraud and double-crossing, Sherlock Holmes will undergo a
descent into hell in what will doubtlessly become one of his most
thrilling cases yet. You will find all the elements of a grand
investigation: examine crime scenes, find the clues, follow the trails,
interrogate suspects and unveil the mystery behind a great adventure,
led by a breath-taking story full of twists

Features:

Lead Holmes darkest investigation: examine crime scenes, find clues,
interrogate suspects

Discover Sherlock Holmes dark side in a breath-taking story full of
twists and turns

Uncover new leads and clues as you explore richly detailed places all
across London

